import React from 'react';

export default () => {
  return (
    <table>
      <tbody>
        <tr>
          <td className={'green'}></td><td>{'- checked by mentor'}</td>
          <td className={'yellow'}></td><td>{'- students working on tdat task now'}</td>
          <td className={'gray'}></td><td>{'- task in todo state'}</td>
          <td className={'pink'}></td><td>{'- need to check'}</td>
          <td className={'red'}></td><td>{'- checked by mentime for checking is gone and no mark from mentor'}</td>
        </tr>
      </tbody>
    </table>
  );
};
